import { Link } from 'react-router-dom';
import { delToken } from '../store';
import { useAppContext } from '../store';
import icon from '../images/icon.PNG';


const Nav = () => {
    const {store, dispatch} = useAppContext();

    return (
        <nav class="navbar navbar-inverse navbar-fixed-top bg-info">
            <div class="container d-flex flex-column flex-md-row justify-content-between ">
                <div class="navbar-header">
                    <button type="button" class="collapsed navbar-toggle" data-toggle="collapse" data-target="#nav_menu" aria-expanded="false">
                        <span class="sr-only">Toggle navigation</span>
                        <span class="icon-bar"></span> 
                        <span class="icon-bar"></span> 
                        <span class="icon-bar"></span>
                    </button>
                    <a class="navbar-brand text-white" href="/">
                        SitterforMoM
                    </a>
                </div>
                <div class="collapse navbar-collapse" id="nav_menu">
                    <ul class="nav navbar-nav text-white">
                        <li class="active">
                            <a href="">HTML</a>
                        </li>
                        <li>
                            <a href="">CSS</a>
                        </li>
                        <li>
                            <a href="">PYTHON</a>
                        </li>
                        <li>
                        {store.isAuthenticated ? (
                            <Link
                                class="py-2 d-none d-md-inline-block text-white"
                                to="/accounts/signout" 
                                onClick={(e) => {
                                    e.preventDefault();
                                    dispatch(delToken());
                                }}
                            >
                                SignOut
                            </Link>
                        ) : (
                            <Link
                                class="py-2 d-none d-md-inline-block text-white"
                                to="/accounts/signin"
                            >
                                SignIn
                            </Link>

                        )}      
                        </li>
                    </ul>
                </div>

            </div>
        </nav>
    );
};

export default Nav;
